리뷰:
발이 너무 아프네요&amp;gt;_&amp;lt;
발볼이 있거나 발등이 높은 분들 절대 비추;;
입구가 좁은 편이라 발이 얇아도 사이즈가 크다면 신기 힘들것 같습니다(입구를 넓게 신으면 안이쁨)
한 사이즈 업했는데... 신발이 발을 조이는 느낌입니다
여러번 신어도 똑같네요
이쁘지만 편하진 않은 신발!

